	(1, 'Рэй Симонс', 'Привет, меня зовут Рэй, я здесь ответственный. Тебе нужно купить интрумент, поэтому покупай топор, далее дуй к деревьям и принимайся их срубать, далее сдавай нам, мы тебе заплатим. ', -569.161, 5247.9, 70.4677, 64.3468, 0, '[]', 's_m_m_autoshop_02', 'WORLD_HUMAN_AA_SMOKE', 0),
	(2, 'Саймон Гэтсби', 'Здарова, не местный? Сбегай за киркой к начальнику, он выдаст снаряжение, потом возвращайся. Камни прямо перед тобой, можешь ломать, когда наберешь достаточно, неси, заплатим за каждый грамм. Увидимся', 2567, 2731.76, 43.2408, 299.217, 0, '[]', 'csb_chef2', 'WORLD_HUMAN_AA_COFFEE', 0),
	(3, 'Сэнди Уоткенс', 'Тебе чего? Здесь скупка всякого мусора. Пустые карманы? Езжай за город, там где фермы, в каждом городке прошерсти мусорки, а весь хлам неси ко мне. Я все выкуплю и заплачу каждый цент. Удачи.. кхэ.. к', 1050.79, -1957.43, 31.0425, 207.656, 0, '[]', 'ig_old_man2', 'WORLD_HUMAN_AA_SMOKE', 0);
